import React, {useState, useEffect} from 'react';
import Panel from './Panel';
import './PanelList.css';


const PanelList = ({ pokedex, cardData, selectedCard  }) => {
    const [card, setCard] = useState(null)
    const [panelPick, setPanelPick] =useState(null)

    useEffect(() => {
        setPanelPick(panelCompon[card]);
        cardData(panelCompon);
        selectedCard(card);
    },[card]);

 

    const panelCompon = pokedex.map((pokemon, i) => {
        return <Panel onChange={num => setCard(num)} panelId={i} id={pokedex[i].id} name={pokedex[i].name} types={pokedex[i].types}/>
    })

    

    return (
        <div>
            <div>
                <div className='emptyBox' id='Block1'>{panelPick}</div>
                <div className='emptyBox' id='Block2'></div>
                <div className='emptyBox' id='Block3'></div>
                <div className='emptyBox' id='Block4'></div>
                <div className='emptyBox' id='Block5'></div>
                <div className='emptyBox' id='Block6'></div>
            </div>
            <div>
                {panelCompon}
            </div>
        </div>
    );
}

export default PanelList;

